          "mkdir ./results",
          "dlprof --reports=all --mode=simple --nsys_opts=\"-t cuda,nvtx --force-overwrite true\" --output_path=./results/  python tensorflow2_cifar10.py --epochs 1 --device gpu"
        ]
      }
    },
    "script_arguments": {
      "profiler": {
